import React from 'react';
import Express from './Express'; // Путь к компоненту DataBase

function Page() {
  // Используем данные, полученные из компонента Express
  const data = Express();

  return (
    <div>
      {/* Выводим данные */}
      <ul>
        {data.map(item => (
          <li key={item.img}></li>
        ))}
      </ul>
    </div>
  );
}

export default Page;
